        return gcd(b, a % b)
    g = a[0]
    for i in range(n):
        g = gcd(g, a[i])
    for i in range(n):
        a[i] //= g
    res = g
    culprit = -1
    g = a[0]
    for i in range(n):
        g = gcd(g, a[i])
        if g == 1:
            culprit = i
            break
    g = a[0 if culprit == --1 else 1]
    for i in range(n):
        if i != culprit:
            g = gcd(g, a[i])
    return res * g
